const aggregateEvents = (events) => {
    console.log(events);
    const eventMap = {}
    events.forEach(event => {
        const eventName = event.summary;

        const time = event.end - event.start;
        console.log(time);

        if (time in eventMap) { 
            eventMap[eventName] += time;
        } else {
            eventMap[eventName] = time;
        }
    });

    return eventMap;
}

const removeTimeZone = (datetime) => {
    datetime = datetime.substring(0, datetime.length - 5);
    return datetime;
}

export default aggregateEvents;
